INSERT INTO `policies` (`id`, `category`, `type`, `policy_description`, `created_at`, `updated_at`) VALUES
(1, 'Gym', 'Safety', 'THINK SAFETY: Exercise with caution. Your safety and others’ welfare are of prime importance.', '2018-01-18 11:03:06', '2018-01-18 11:03:06'),
(2, 'Gym', 'Safety', 'Warm up properly to avoid injury.', '2018-01-18 11:03:06', '2018-01-18 11:03:06'),
(3, 'Gym', 'Safety', 'Lift poundages you can safely handle. Avoid ego-lifting', '2018-01-18 11:03:06', '2018-01-18 11:03:06'),
(4, 'Gym', 'Safety', 'Handle equipment and weights properly to prevent injury. E.g. dropping of dumbbells of weights.', '2018-01-18 11:03:06', '2018-01-18 11:03:06'),
(5, 'Gym', 'Safety', 'All weights and equipment must be returned back in place after use.', '2018-01-23 23:28:20', '2018-01-24 05:52:00'),
(6, 'Gym', 'Safety', 'Avoid leaning on the glasses and window panes.', '2018-01-24 08:40:48', '2018-01-24 11:52:52'),
(7, 'Gym', 'Safety', 'Ask for assistance when needed.', '2018-01-24 12:54:51', '2018-01-24 14:56:56'),
(8, 'Gym', 'Courtesy', 'Always wear the proper attire while training in the gym. I.e: Rubber shoes, T-shirt, Short Pants/Jogging Pants', '2018-01-24 03:35:29', '2018-01-24 09:48:47'),
(9, 'Gym', 'Courtesy', 'Bring your towels for hygienic purposes.', '2018-01-24 06:44:42', '2018-01-24 07:41:37'),
(10, 'Gym', 'Courtesy', 'Each member must respect the rights of other gym members.', '2018-01-24 07:38:44', '2018-01-24 07:41:44'),
(11, 'Gym', 'Courtesy', 'Behave in an appropriate manner at all times.', '2018-01-24 07:39:32', '2018-01-24 09:42:40'),
(12, 'Gym', 'Courtesy', 'Always secure and care for your personal belongings at all times.', '2018-01-24 13:44:49', '2018-01-24 11:49:47'),
(13, 'Gym', 'Courtesy', 'Bring home your work-out clothes and rubber shoes or avail for a locker instead.', '2018-01-24 10:38:49', '2018-01-24 13:52:51'),
(14, 'Gym', 'Policies', 'The registration form is a property of Altitude Gym and should not be taken out from the gym.', '2018-01-24 06:39:37', '2018-01-24 09:23:27'),
(15, 'Gym', 'Policies', 'Smoking inside the gym and its premises is strictly prohibited.', '2018-01-24 02:23:24', '2018-01-24 10:47:47'),
(16, 'Gym', 'Policies', 'Clients/Members under the influence of alcohol are not allowed for workouts.', '2018-01-24 02:30:34', '2018-01-24 07:39:40'),
(17, 'Gym', 'Policies', 'Denim jeans or shorts are not allowed inside the gym and its premises.', '2018-01-24 00:30:34', '2018-01-24 09:44:40'),
(18, 'Gym', 'Policies', 'Slippers or sandals are not allowed for workouts.', '2018-01-24 06:35:38', '2018-01-24 05:34:36'),
(19, 'Gym', 'Policies', 'Gym instructors are no longer available after 8:00 PM.', '2018-01-24 00:28:36', '2018-01-24 02:29:34'),
(20, 'Gym', 'Policies', 'Altitude Gym has the right to refuse clients to use the gym due to willful and habitual disregard of the rules, regulations and policies.', '2018-01-24 03:29:30', '2018-01-24 04:30:29'),
(21, 'Gym', 'Policies', 'Student/s who graduated college are to avail regular membership the month he/she graduated.', '2018-01-24 03:32:34', '2018-01-24 07:47:47'),
(22, 'Gym', 'Policies', 'Monthly fees are not refundable, transferable, and must be paid on time.', '2018-01-24 03:28:28', '2018-01-24 06:36:36'),
(23, 'Gym', 'Policies', 'Clients/Members can pay fees in advance.', '2018-01-23 23:31:35', '2018-01-24 10:39:35'),
(24, 'Gym', 'Policies', 'Clients/Members can only have one program at a time.', '2018-01-24 05:37:38', '2018-01-24 07:42:46'),
(25, 'Gym', 'Policies', 'Clients/Members need to finish the program chosen before choosing another one.', '2018-01-24 04:32:34', '2018-01-24 11:49:50'),
(26, 'Gym', 'Policies', 'Clients/Members can check or mark their workout as done after doing it.', '2018-01-24 10:46:42', '2018-01-24 06:44:48'),
(27, 'Gym', 'Policies', 'Members who lost their RFID should pay a fine.', '2018-01-24 01:31:34', '2018-01-24 03:37:40'),
(28, 'Gym', 'Policies', 'Members who forgot to bring their RFID should use the logbook to log in and out of the gym. ', '2018-01-24 06:37:22', '2018-01-24 03:29:32'),
(29, 'Gamification', 'Points', 'Members would gain points by finishing programs or activities within the gym, with verification from gym personnel.', '2018-01-25 04:30:32', '2018-01-25 06:36:00'),
(30, 'Gamification', 'Points', 'Different activities give corresponding points.', '2018-01-25 06:44:45', '2018-01-25 07:37:36'),
(31, 'Gamification', 'Points', 'Members can only gain points on the same activity 3 times in one day; succeeding     repetition of the activity would not yield any more points.', '2018-01-25 08:40:00', '2018-01-25 10:46:00'),
(32, 'Gamification', 'Points', 'Members can also earn points by gaining badges.', '2018-01-25 09:45:00', '2018-01-25 11:48:46'),
(33, 'Gamification', 'Points', 'Non-active members cannot gain badges even if they meet the requirements.', '2018-01-25 07:39:40', '2018-01-25 10:47:46'),
(34, 'Gamification', 'Points', 'Members cannot pass the points they gained to other members.', '2018-01-25 10:45:44', '2018-01-25 06:42:44'),
(35, 'Gamification', 'Leveling', 'Members would level up by reaching a certain amount of points based on their current level.', '2018-01-25 13:45:40', '2018-01-25 07:46:47'),
(36, 'Gamification', 'Leveling', 'Rank will serve as the categories and basis for the leaderboards.', '2018-01-25 07:40:44', '2018-01-25 12:47:45'),
(37, 'Gamification', 'Leveling', 'Leveling Formula:\r\nWhere: x = amount of points needed to level up\r\n       B = the base point of the rank\r\n       rb = the starting level of the rank\r\n       i = increment value of additional level\r\n       cl = current level\r\nx = B + [i*(cl-rb)]', '2018-01-25 01:28:32', '2018-01-25 03:34:39'),
(38, 'Gamification', 'Badges', 'Members can only earn a specific badge once.', '2018-01-25 07:37:41', '2018-01-25 09:43:44'),
(39, 'Gamification', 'Badges', 'Badges can be earned by achieving the badges requirements.', '2018-01-25 06:40:41', '2018-01-25 05:36:41'),
(40, 'Gamification', 'Badges', 'Members cannot lose a badge they have already obtained.', '2018-01-25 06:38:40', '2018-01-25 08:43:42'),
(41, 'Gamification', 'Badges', 'Badges are earned automatically by meeting certain requirements.', '2018-01-25 10:44:46', '2018-01-25 09:43:44'),
(42, 'Gamification', 'Badges', 'Badges cannot be transferred to other members.', '2018-01-25 04:36:39', '2018-01-25 07:40:40'),
(43, 'Gym', 'Courtesy', 'Avoid distracting others while in the gym', '2018-04-02 10:24:53', '2018-04-02 10:27:23'),
(44, 'Gamification', 'Point', 'Members would receive points when finishing workouts', '2018-04-02 10:30:17', '2018-04-02 10:30:33');
